window.bookSummaryJSON = "<p>Penguin presents the unabridged, downloadable audiobook edition of <i>Doctor Who: 12 Doctors 12 Stories</i>. A brand-new 12th Doctor story for a brand-new 12th Doctor! </p><p>Following on from the success of the 50th anniversary paperback anthology, <i>11 Doctors 11 Stories</i>, this highly-acclaimed collection of short Doctor Who stories contains all of the original 11 adventures plus an exciting new 12th Doctor story written by best-selling US author Holly Black. </p><p>Authors featured are Eoin Colfer, Michael Scott, Marcus Sedgwick, Philip Reeve, Patrick Ness, Richelle Mead, Malorie Blackman, Alex Scarrow, Charlie Higson, Derek Landy, Neil Gaiman, and Holly Black.</p>"; 
